import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Hola Fashion</h1>
        <p>Your Fashion Destination</p>
      </header>
      <main>
        <p>This is a new React application for Hola Fashion.</p>
      </main>
    </div>
  );
}

export default App;
